create database Cricket;

show databases;

use cricket;

#--------------------SCHEMA-------------------------
#Player (PCode, FirstName, LastName, Age, MatchPlayed, RunScored, WicketTaken, Country)

#Deleting the entire table

drop Table Player;

#Creating a Table in the database:
#---------------------------------

CREATE TABLE Player (
PCode char(5) PRIMARY KEY,
FirstName varchar(20) NOT NULL,
LastName varchar(20) NOT NULL,
Age int BETWEEN 15 AND 50,
MatchPlayed int,
RunScored int,
WicketTaken int,
Country varchar(20)
);

show tables;
